class Forum extends React.Component {

  constructor(props){
    super(props)
  }

  render() {
    return (
      <div>
          <tr>
            <th style={{width: ""}} class="col-3" scope="row">{this.props.idx}</th>
            <td class="col">{this.props.forum.topic}</td>
          </tr>
      </div>
    )
  }
}
export default Forum
